import { useSelector } from 'react-redux'
import { selectCookieById } from './cookiesApiSlice'

const Cookie = ({ cookieId }) => {
    const cookie = useSelector(state => selectCookieById(state, cookieId))

    if (cookie) {
        return (
            <div className='clothes'> 
                    <div className='clothing' key={cookie.id}>
                        <div className='img'>
                            <img src={`../Assets/${cookie.picturePath}`} alt='' />
                        </div>
                        <div className='content'>
                            <h1>{cookie.name}</h1>
                            <p>{cookie.desc}</p>
                            <p>{cookie.price}</p>
                        </div>
                    </div>
            </div>
        )
    }
}
export default Cookie
